import React, { useState } from 'react';
import TextDisplay from './TextDisplay';
import SummaryModal from './SummaryModal';

const ResultsDisplay = ({ results }) => {
    const [showModal, setShowModal] = useState(false);
    const [activeTab, setActiveTab] = useState('summary');

    if (!results) {
        return (
            <div className="results-display empty">
                <h2>Analysis Results</h2>
                <p>No results available. Please perform an analysis.</p>
            </div>
        );
    }

    // Determine confidence level classes
    const getConfidenceClass = (score) => {
        if (score > 80) return 'high-confidence';
        if (score > 60) return 'medium-confidence';
        return 'low-confidence';
    };

    return (
        <div className="results-display">
            <h2>Analysis Results</h2>

            {/* Tab Navigation - Updated to match FactChecker.js style */}
            <div className="input-options">
                <button 
                    className={activeTab === 'summary' ? 'active' : ''}
                    onClick={() => setActiveTab('summary')}
                >
                    Analysis Summary
                </button>
                <button 
                    className={activeTab === 'content' ? 'active' : ''}
                    onClick={() => setActiveTab('content')}
                >
                    Article Content
                </button>
            </div>
            <div className={`classification-result ${results.classification === 'Likely Reliable' ? 'reliable' : 'suspicious'}`}>
                <h3>{results.classification}</h3>
                <p className={getConfidenceClass(results.confidenceScore)}>
                    Confidence: {results.confidenceScore}%
                    <span className="confidence-interval">
                        (95% CI: {results.confidenceInterval[0]}% - {results.confidenceInterval[1]}%)
                    </span>
                </p>
                <button className="view-metrics-btn" onClick={() => setShowModal(true)}>
                    View Detailed Metrics
                </button>
            </div>


            {/* Tab Content */}
            <div className="tab-content">
                {activeTab === 'summary' && (
                    <>
                        <div className="metrics">
                            <div className="metric">
                                <h4>Shannon Entropy</h4>
                                <div className="score-bar">
                                    <div 
                                        className="score-fill"
                                        style={{width: `${Math.min(results.entropyScore * 20, 100)}%`}}
                                    ></div>
                                </div>
                                <p>{results.entropyScore}</p>
                                <small>Higher value indicates more complex language</small>
                            </div>

                            <div className="metric">
                                <h4>KL Divergence</h4>
                                <div className="score-bar">
                                    <div 
                                        className="score-fill"
                                        style={{width: `${Math.min(results.klDivergence * 100, 100)}%`}}
                                    ></div>
                                </div>
                                <p>{results.klDivergence}</p>
                                <small>Lower value indicates closer match to reliable sources</small>
                            </div>
                        </div>

                        <div className="explanation">
                            <h4>Analysis Explanation</h4>
                            <p>{results.details}</p>
                        </div>
                    </>
                )}

                {activeTab === 'content' && results.originalText && (
                    <TextDisplay 
                        text={results.originalText} 
                        problematicElements={results.problematicElements}
                    />
                )}
            </div>

            <SummaryModal 
                isOpen={showModal}
                onClose={() => setShowModal(false)}
                results={results}
            />
        </div>
    );
};

export default ResultsDisplay;
